import React from 'react'

function ProductList({ products }) {
  return (
    <div>
      {products.map}((product) => ( <div key={product.id}> <h2>{product.name}</h2> </div>) )
      <h2>Search Results</h2>
    </div>
  )
}

export default ProductList
